import axios from "axios";


class Repository {


  jwt = "";

  #BaseUrl = "";

  instance = undefined;

  constructor() {
    this.#BaseUrl = "http://localhost:8095/api";
    this.jwt = localStorage.getItem('jwt');


    this.instance = axios.create({
      headers: {
        "auth-token": `Bearer ${this.jwt}`
      }
    });
  }


  async signupUser(user) {
    try {
      const res = await this.instance.post(`${this.#BaseUrl}/v1/signup`, user);
      return res.data;
    } catch (err) {
      throw err;
    }
  }


  async loginUser(user) {
    return axios.post(`${this.#BaseUrl}/login/user`, user).then(res => {
      return res.data;
    }).catch(err => {
      throw err;
    });

    // try {
    //   const res = await this.instance.post(`${this.#BaseUrl}/login/user`, user);
    //   return await res.data;
    // } catch (err) {
    //   throw err;
    // }
  }

  async showAllCourses() {

    return axios.get(`${this.#BaseUrl}/user/courses`).then(res => {
      return res.data;
    }).catch(err => {
      throw err;
    });
    // try {

    //   const res = await this.instance.get(`${this.#BaseUrl}/user/courses`);
    //   return res.data;
    // } catch (err) {
    //   throw err;
    // }
  }

  async getStuentProfile(currentUser, token) {
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/student/profile/${currentUser}`, {
        headers: {
          "auth-token": `Bearer ${token}`
        }
      });
      return res.data;
    } catch (err) {
      throw err;
    }

  }

  async getTeacherProfile(currentUser, token) {

    try {
      const res = await this.instance.get(`${this.#BaseUrl}/teacher/profile/${currentUser}`,{
        headers: {
          "auth-token": `Bearer ${token}`
        }
      });
      return res.data;
    } catch (err) {
      throw err;

    }

  }

  async getAllStudents() {

    try {

      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allStudents`);
      return res.data;
    } catch (err) {
      throw err;

    }

  }

  async getAllTeachers() {

    try {

      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allTeachers`);
      return res.data;
    } catch (err) {
      throw err;

    }
  }

  async getAllUsers(){
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allUsers`);
      return res.data;
    }catch (err) {
      throw err;
    }
  }

  async getStudentsCount() {
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allStudents`);
      return res.data.length;
    } catch (err) {
      throw err;
    }
  }

  async getTeachersCount() {
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allTeachers`);
      return res.data.length;
    } catch (err) {
      throw err;
    }
  }

  async getTotalCount() {
    const studentsCount = await this.getStudentsCount();
    const teachersCount = await this.getTeachersCount();
    return studentsCount + teachersCount;
  }

  async getAllCourses(token) {
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allCourses`, {
        headers: {
          "auth-token": `Bearer ${token}`
        }
      });
      return res.data;
    } catch (err) {
      throw err;
    }
  }

  async getTotalCourses() {
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/allCourses`);
      return res.data.length;
    } catch (err) {
      throw err;
    }
  }


  async getTeachersWithNoCourses() {
    try {
      const res = await this.instance.get(`${this.#BaseUrl}/managementTeam/teachersWithNoCourses`);
      return res.data;
    } catch (err) {
      throw err;
    }
  }

  async logoutUser(token) {

    return axios.get(`${this.#BaseUrl}/logout/user`, {
      headers: {
        "auth-token": `Bearer ${token}`
      }
    }).then(res => {
      localStorage.setItem("jwt", "");
      localStorage.setItem("userRole", "");
      localStorage.setItem("currentUser", "");
      return res.data;
    }).catch(err => {
      throw err;
    })

  }

  async enrollToCourse(request) {
    try{
        const res = await this.instance.post(`${this.#BaseUrl}/student/enroll/course`, request);
        return res.data;
    } catch (err) {
        throw err;
    }
}

async enrolledCourses(currentUser, token) {
  try{
      const res = await this.instance.get(`${this.#BaseUrl}/student/enrolled/courses/${currentUser}`, {
        headers: {
          "auth-token": `Bearer ${token}`
        }
      });
      return res.data;
  } catch (err) {
      throw err;
  }
}

async checkEnrollment(courseID, currentUser, token) {
  try{
      const res = await this.instance.get(`${this.#BaseUrl}/student/${courseID}/enrolled/${currentUser}`, {
        headers: {
          "auth-token": `Bearer ${token}`
        }
      });
      return res.data;
  } catch (err) {
      throw err;
  }
}

async unenrollFromCourse(courseID, currentUser) {
  try{
      const res = await this.instance.delete(`${this.#BaseUrl}/student/unenroll/${courseID}/${currentUser}`);
      return res.data;
  } catch (err) {
      throw err;
  }
}

async assignedCourse(currentUser) {
  try{
      const res = await this.instance.get(`${this.#BaseUrl}/teacher/assigned/course/${currentUser}`);
      return res.data;
  } catch (err) {
      throw err;
  }
}

async courseEnrollments(courseID) {
  return axios.get(`${this.#BaseUrl}/user/enrolled/students-for-course/${courseID}`).then(res => {
    return res.data;
  }).catch(err => {
    throw err;
  });
}

async createCourse(addCourseRequest) {
  try{
      const res = await this.instance.post(`${this.#BaseUrl}/managementTeam/create-course`, addCourseRequest);
      return res.data;
  } catch (err) {
      throw err;
  }
}


}

export default new Repository();
